MongoDB Aggregate Multiple grouping based on time<p>I'm trying to show the top customers in the last 24 hours and last 12 hours using a single query.
We save the total orders of the customer in the db every hour.
The raw data are something like the below, but I changed the data for confidentiality:</p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;64c8de6e10f1e5f6958033d7&quot;),
    &quot;address&quot;: &quot;nowhere&quot;,
    &quot;city&quot;: &quot;NY&quot;,
    &quot;name&quot;: &quot;ABD&quot;,
    &quot;count&quot;: NumberInt(19),
    &quot;timestamp&quot;: ISODate(&quot;2023-08-01T05:30:42.956Z&quot;)
  },
  {
    &quot;_id&quot;: ObjectId(&quot;64c8de6e10f1e5f6958033d6&quot;),
    &quot;address&quot;: &quot;somewhere&quot;,
    &quot;city&quot;: &quot;NY&quot;,
    &quot;name&quot;: &quot;WBE&quot;,
    &quot;count&quot;: NumberInt(4),
    &quot;timestamp&quot;: ISODate(&quot;2023-08-01T05:29:02.956Z&quot;)
  },
  {
    &quot;_id&quot;: ObjectId(&quot;64c8de6e10f1e5f6958033da&quot;),
    &quot;address&quot;: &quot;somewhere&quot;,
    &quot;city&quot;: &quot;NY&quot;,
    &quot;name&quot;: &quot;WBE&quot;,
    &quot;count&quot;: NumberInt(18),
    &quot;timestamp&quot;: ISODate(&quot;2023-08-01T08:30:42.956Z&quot;)
  }
  ...
]
</code></pre>
<p>The result I was trying to go for was something like:</p>
<pre><code>{
  last12Hours: [{ name: &quot;WBE&quot;, city:&quot;NY&quot;, count: &quot;18&quot; }, {name: &quot;ABD&quot;, city:&quot;NY&quot;, count: &quot;12&quot;}],
  last24Hours: [{ name: &quot;WBE&quot;, city:&quot;NY&quot;, count: &quot;30&quot; }, {name: &quot;ABD&quot;, city:&quot;NY&quot;, count: &quot;20&quot;}],
}
</code></pre>
<p>This is simple if I run two queries where I change the timestamp match to 12 hours before and 24 hours before:</p>
<pre><code>db.collection.aggregate([
  {
    $match: {
      timestamp: {
        $gte: ISODate(&quot;2023-08-01T03:36:38.059Z&quot;)
      },
    },
  },
  {
    $group: {
      _id: &quot;$name&quot;,
      count: {
        $sum: &quot;$count&quot;
      },
     city: { $first: &quot;$city&quot;}
    },
  },
  {
    $sort: {
      count: -1
    }
  },
  {
    $limit: 5,

  },
  {
    $project: {
      _id: 0,
      name: &quot;$_id&quot;,
      city: &quot;$city&quot;,
      count: 1,
    },
  },
])
</code></pre>
<p>I also tried something that has to do with intervals but that was a disaster of a query and didn't work as expected.</p>
<p>I appreciate hints, I'm not supposedly asking for anyone to just solve it. Thank you!</p>

