embedfield:
Using markModified in a class without extending mongoose.Document<p>I am using a simple queue type in Typescript using mongoose ODM. As mongoose has no way of knowing when you directly mutate an array rather then assigning a value to it, I need use the Document's <code>markModified</code> function to mark the array as dirty so it will be saved on the next save() call.</p>
<p>According to mongoose documentation, extending <code>mongoose.Document</code> is strongly discouraged and is no longer supported in versions 7+. I'd like to keep the management of marking <code>items</code> as modified within the class itself, as it may have more complex logic on how and when the item array is modified. However, since the class does not directly inherit from mongoose.Document, I do not have access to the <code>markModified</code> function to do so.</p>
<p>Is there a way to make sure the array is marked as modified while also adhering to mongoose's strong suggestion of not extending Document?</p>
<p>It would be possible to do so in the code that fetches the queue, but the logic of when the queue may be modified may be complex, and I wouldn't like to have to add a markModified whenever an outside code touches the queue.</p>
<p>This is a stripped down example of the code as it exists today:</p>
<pre><code>import { itemSchema, Item } from &quot;./items&quot;;

const schemaKey = &quot;player_item_queue&quot;;
const schema = new mongoose.Schema(
    {
        user_id: { type: String, required: true },
        items: {type: [itemSchema], default: [] },
    });

export class PlayerItemQueue extends mongoose.Document&lt;PlayerItemQueue&gt;
{
    user_id: string;
    items: Item[];

    public add(item: Item): void
    {
        this.items.push(item);
        this.markModified('items');
    }

    public pop(): Item
    {
        return this.items.pop();
        this.markModified('items');
    }
}

schema.loadClass(PlayerItemQueue);
export const PlayerItemQueueModel = mongoose.model&lt;PlayerItemQueue&gt;(schemaKey, schema);
export { schema as PlayerItemQueueSchema };
</code></pre>

